-- Table structure for `fa_wechat_user`
-- ----------------------------
DROP TABLE IF EXISTS `fa_wechat_user`;
CREATE TABLE `fa_wechat_user` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '关联用户id',
  `opneid` varchar(100) NOT NULL DEFAULT '' COMMENT 'opneid',
  `nickname` varchar(150) NOT NULL DEFAULT '' COMMENT '微信名字',
  `sexdata` enum('1','2') NOT NULL DEFAULT '1' COMMENT '性别:1=男,2=女',
  `city` varchar(100) NOT NULL DEFAULT '' COMMENT '城市',
  `country` varchar(100) NOT NULL DEFAULT '' COMMENT '国家',
  `province` varchar(100) NOT NULL DEFAULT '' COMMENT '省份',
  `language` varchar(20) NOT NULL DEFAULT '' COMMENT '语言',
  `headimgurl` text NOT NULL COMMENT '头像',
  `createtime` int(10) NOT NULL DEFAULT '0' COMMENT '加入时间',
  `unionid` varchar(255) NOT NULL DEFAULT '' COMMENT '开放平台id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='wechat_user';

-- ----------------------------
-- Records of fa_wechat_user
-- ----------------------------

-- ----------------------------
-- Table structure for `fa_worker_user`
-- ----------------------------
DROP TABLE IF EXISTS `fa_worker_user`;
CREATE TABLE `fa_worker_user` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '用户',
  `real_id` int(10) NOT NULL DEFAULT '0' COMMENT '小区',
  `name` varchar(100) NOT NULL DEFAULT '' COMMENT '姓名',
  `mobile` varchar(11) NOT NULL DEFAULT '' COMMENT '手机号',
  `id_card` varchar(20) NOT NULL DEFAULT '' COMMENT '身份证号',
  `statusdata` enum('0','1') NOT NULL DEFAULT '0' COMMENT '是否休息:0=休息,1=工作',
  `createtime` int(10) NOT NULL DEFAULT '0' COMMENT '加入时间',
  `skill` varchar(255) NOT NULL DEFAULT '' COMMENT '技能',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='worker_user';

-- ----------------------------
-- Records of fa_worker_user
-- ----------------------------
